import React, { Component } from 'react'

class Childcard1 extends Component {
  render() {
    return (
        <div className="Card1">
        <div className="profile-photos">
            <img alt="user" className="profile-photos" src="https://www.gravatar.com/avatar/205e460b479e2e5b48aec07710c08d50" />
        </div>
        <div className="personal-data">
            <h2>Name</h2>
            <h5>Position</h5>
        </div>
        <div className="team-member" color='white'>^
        </div>
    </div>

    )
  }
}
export default Childcard1;
